ents=2,copy=False, svd_solver='randomized')\n            pca.partial_fit(arrays)\n        else:\n           pca.partial_fit(arrays)\n\n        arrays=None\n        toc1 = time.perf_counter()\n        perf[g//timeStep][3] = toc1 - tic1  \n        toc3 = time.perf_counter()\n        perf[g//timeStep][0] = toc3 - tic3\n\n\n\nprint(\"pca, \", pca, flush=True)\nResults.append([pca.explained_variance_ , pca.singular_values_])\ntp = time.perf_counter()\nprint(\"Total time to Dask solution is \", tp-t)\n\npperf = pd.DataFrame(perf,columns=['generation', 'getdata', 'getdataq', 'computation'])\npdata = pd.DataFrame(Results,columns=[ 'his', 'bins'])\n\nwith open(\"perf.csv\", \"a\") as fperf:\n    pperf.to_csv(fperf, encoding='utf-8', index=False)\n    \nwith open(\"diag.csv\", \"a\") as fdiag:\n    pdata.to_csv(fdiag, encoding='utf-8', index=False)\n    \nC.Finalization()\n    \n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"color_mapper":{"id":"1151"},"coordinates":null,"formatter":{"id":"1177"},"group":null,"label_standoff":12,"location":[0,0],"major_label_policy":{"id":"1449"},"ticker":{"id":"1178"}},"id":"1176","type":"ColorBar"},{"attributes":{"start":0},"id":"1185","type":"DataRange1d"},{"attributes":{"coordinates":null,"data_source":{"id":"1150"},"glyph":{"id":"1171"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1173"},"nonselection_glyph":{"id":"1172"},"view":{"id":"1175"}},"id":"1174","type":"GlyphRenderer"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"start":0},"id":"1372","type":"DataRange1d"},{"attributes":{"tools":[{"id":"1386"},{"id":"1387"},{"id":"1388"}]},"id":"1389","type":"Toolbar"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"axis":{"id":"1166"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1168","type":"Grid"},{"attributes":{"child":{"id":"bk-
